import React, {useState, useEffect} from 'react';
import clsx from 'clsx';
import {makeStyles} from '@material-ui/core/styles';
import {apolloClient} from "../../../utils";
import {GET_AD_SELL_LEASES} from "../../../graphql/ad_sell_leases/queries"
// import uuid from "uuid";
// import dynamic from 'next/dynamic'
// const uuid=dynamic(import ('uuid'),{ssr:false})


const useStyles = makeStyles(theme => ({
    root: {},
    posts: {
        marginTop: theme.spacing(2)
    },
    post: {
        marginBottom: theme.spacing(2)
    }
}));

interface PostType {
    id: any,
    author:{
        name:string,
        avatar:string,

    },
    created_at:string,
    message:string,
    media:string,
    avatar:string,
    name:string,
    comments:{
        id:any,
        author:{
            avatar:string,
            name:string
        }
        created_at:string,
        message:string,
    }[],
    liked:boolean,
    likes:number,
}

interface TimelineProps {
    className ?: string
}

const Timeline: React.FunctionComponent<TimelineProps> = (props: TimelineProps) => {
    const { className,  ...rest } = props
    let [project, serProject] = React.useState()
    const classes = useStyles();
    const [posts, setPosts] = useState<PostType[]>([]);
    let userId = { user: "5e7b82a48928eb4d96c1a526"}
    let userFilter = JSON.stringify(userId)
    useEffect(() => {
          apolloClient.query({query: GET_AD_SELL_LEASES, variables: {
                "page": 1,
                "limit": 10,
                "filter": userFilter
            }}).then(response => { 
                serProject(response.data)
            })
        const fetchPosts = () => {
            setPosts([{
                id: "1",
                author:{
                    name:"Shen Zhi",
                    avatar:"https://react-material-kit.devias.io/images/avatars/avatar_11.png",
                },
                created_at:"1 1 2020",
                message:"Just made this home screen for a project, what-cha thinkin?",
                media:"https://react-material-kit.devias.io/images/posts/post_1.jpg",
                avatar:"https://react-material-kit.devias.io/images/avatars/avatar_5.png",
                name:"string",
                comments:[{
                    id:"1",
                    author:{
                        avatar:"https://react-material-kit.devias.io/images/avatars/avatar_5.png",
                        name:"Anje Keizer"
                    },
                    created_at:"1 1 2020",
                    message:"Could use some more statistics, but that’s me haha",
                }],
                liked:false,
                likes:10,
            }])
        }
        fetchPosts()
    }, [])
    const _posts = [
        {
            id: "1",
            author:{
                name:"Shen Zhi",
                avatar:"https://react-material-kit.devias.io/images/avatars/avatar_11.png",
            },
            created_at:"1 1 2020",
            message:"Just made this home screen for a project, what-cha thinkin?",
            media:"https://react-material-kit.devias.io/images/posts/post_1.jpg",
            avatar:"https://react-material-kit.devias.io/images/avatars/avatar_5.png",
            name:"string",
            comments:[{
                id:"1",
                author:{
                    avatar:"https://react-material-kit.devias.io/images/avatars/avatar_5.png",
                    name:"Anje Keizer"
                },
                created_at:"1 1 2020",
                message:"Could use some more statistics, but that’s me haha",
            }],
            liked:false,
            likes:10,
        }
    ]
    return (
        <div {...rest} className={clsx(classes.root, className)}>
            <h1>Dự án</h1>
        </div>
    );
};


export default Timeline;
